import React from "react";
import Navbar from "../Layout/Navbar";

export default function StudentLiveClass() {
  console.log("StudentLiveClass mounted");

  return (
    <>
      <Navbar />
      <div style={{ padding: 30, textAlign: "center" }}>
        <h2>ðŸ“º Live Class</h2>
        <p>Waiting for teacher to start the class...</p>

        <div
          style={{
            width: "70%",
            height: "360px",
            background: "#000",
            margin: "auto",
            borderRadius: 12,
            color: "white",
            display: "flex",
            alignItems: "center",
            justifyContent: "center"
          }}
        >
          Teacher video will appear here
        </div>

        <br />
        <button
          className="danger-btn"
          onClick={() => window.history.back()}
        >
          Leave Class
        </button>
      </div>
    </>
  );
}
